import { AfterViewInit, Component, ElementRef, OnInit, ViewChild } from '@angular/core';
import { ResponsiveShellService, StylingObserver } from './responsive-shell.service';
import { Observable } from 'rxjs';

export type WindowSize = {width: number, height: number};

@Component({
  selector: 'responsive-shell',
  templateUrl: './responsive-shell.component.html',
  styleUrls: ['./responsive-shell.component.css']
})
export class ResponsiveShellComponent implements OnInit, AfterViewInit {

  Styles: StylingObserver = {};
  WindowDimensions: WindowSize = {
    width: 0,
    height: 0
  };

  @ViewChild('resizeFrame', {static: false}) ResizeFrame: ElementRef | undefined;

  constructor( private data: ResponsiveShellService) {
    this.WindowDimensions = {
      width: this.ResizeFrame?.nativeElement.offsetWidth,
      height: this.ResizeFrame?.nativeElement.offsetHeight
    };
  }

  ngOnInit(): void {
    this.data.getSrcryBoxStyles().subscribe(val => this.Styles = val);
    //this.Styles = this.data.createSrcryBoxSettings();
  }

  ngAfterViewInit(): void{
    //console.log(this.Styles);
    this.data.updateCrushGapW('17');
    //this.data.updateCrushGapH('33');
    this.data.updateBaseSizeW({size: 'tiny', scale: '1', speed: '9'});
    this.data.updateBaseSizeH({size: 'xSmall', scale: '1', speed: '7'});
    this.data.updateEdgeChaseW({size: 'loMed', scale: '2', speed: '7'});
    this.data.updateChaseStopW({size: 'hiMed', scale: '1', speed: '3'});
    //this.data.updateSrcryBoxSettings();
    console.log(this.Styles);
  }

  public provideStyles(){ return this.Styles; }

  public sizeListener(entry: ResizeObserverEntry[]):void{
    this.WindowDimensions = {
      width  : Math.floor(entry[0].contentRect.width),
      height : Math.floor(entry[0].contentRect.height)
    };
  }

}

